COPY public.class_lore (character_class, description, id) FROM stdin;
Bard	In Everquest, Bards are the maestros of a grand adventure, their existence a rhapsody echoing through Norrath's expanse. They are more than musicians; they are the composers of an epic saga, each lyric and chord a vibrant note in a symphony of legend and lore. Their journey is a brisk accelerando, quickening the pace of adventure with an infectious allegro rhythm. Bards transform travel into a capriccio, carrying ancient ballads and heroic sonnets across the land. In combat and camaraderie, their skills crescendo, energizing allies with a fortissimo surge. Their songs resonate like a sforzando, striking chords of energy and enthusiasm. Their repertoire, akin to a grand concerto, ranges from soothing adagios to invigorating vivaces, expertly modulating the dynamics of their ensemble. Bards in Norrath's lore are the legato threads connecting past to present, each performance a cantata of courage and an aria of adventure. Embracing the Bard's path is to become a custodian of the world's harmonious secrets. In Everquest's musical narrative, Bards are the soloists, their instruments weaving a sonnet of adventure and whimsy. Their existence is a serenade to Norrath, a fugue intertwining the tales of gods, heroes, and all souls.	1
Enchanter	In the mystical realm of Everquest, Enchanters are the subtle weavers of illusion, their artistry woven into the very fabric of reality. Their true shield is the art of deception, and their mastery over the arcane is unmatched. Enchanters are not mere practitioners of magic; they are the puppeteers of perception, manipulating the threads of truth and lies with finesse. Their spells are like the delicate threads in a grand tapestry of confusion, ensnaring the senses of both friend and foe alike. Enchanters weave enchantments that cloud the mind and distort reality, their incantations shrouded in the shadows of deceit. Renowned for their spells of haste, they quicken the steps of their companions, leaving a trail of chaos in their wake. Masters of illusion, Enchanters craft mirages that blur the lines between truth and falsehood. Their illusions are more than mere apparitions; they are intricate webs of lies, each strand designed to ensnare and bewilder. In the grand theatre of Norrath, they adopt personas that defy reality, their transformations a dance of deception. In the chaos of combat, Enchanters emerge as the serene manipulators of discord. With a subtle gesture, they can mesmerize adversaries, lulling them into a false sense of security before the inevitable revelation of their true intentions. Their spells sow confusion and misdirection, leaving their foes lost in a labyrinth of falsehoods. Enchanters are the shadowy puppet-masters of Norrath, their illusions a testament to their artful subterfuge.	2
Magician	Magicians in Everquest are esteemed for their exceptional summoning abilities, expertly calling forth elemental pets to assist in their ventures. Their signature trait is their powerful and loyal elemental companions, integral to both their offense and defense. These pets not only protect their master but also possess formidable attacks and unique skills. Magicians excel in a variety of summoning spells, capable of creating useful items such as food, magical jewelry, and more, right out of thin air. In combat, they can shield their group with a barrier that damages any foe who dares strike them. They also have the ability to lower a monster's resistance to magic, making them more susceptible to spell damage. A distinctive ability of high-level magicians is teleporting group members to their location, an invaluable skill in both group play and raids. Magicians focus intensely on their summoning prowess, forgoing a broader range of abilities for mastery in this area. They can venture alone effectively and are a strong addition to any group. This class is ideal for players who relish the role of a summoner, wielding control over powerful elemental beings and utilizing a focused selection of spells. In Everquest lore, magicians are the quintessential summoners, their deep understanding of conjuration unmatched. They are often portrayed as scholars and mystics, delving into the arcane secrets of summoning magic. Their elemental pets are not mere tools but are seen as extensions of the magicians themselves, embodying their mastery over the arcane arts. In every corner of Norrath, from the bustling cities to the remote outposts, magicians are revered for their ability to bend the fabric of reality, calling forth allies and resources from the ether to aid in their quests.	3
Necromancer	Necromancers in Everquest are enigmatic figures, wielding the dark arts to manipulate life and death. Their expertise lies in a variety of spells, harnessing the elements of fire, magic, poison, and disease to overpower enemies and aid allies. This dark path has made them outcasts in many old-world civilizations, forcing them to rely on their self-sufficiency and powers rather than external support or equipment. The essence of a Necromancer's power is their profound understanding of life and death, granting them abilities to control and terrify their foes. They can mesmerize, snare, and instill fear, transfer mana and health to allies, and dominate the undead with spells that deal direct damage, charm, root, and lull. Specializing in anti-natural magic, they possess unique spells effective against animals and plant-based creatures. Necromancers are known for their formidable pets, highly efficient Damage over Time (DoT) spells, and control abilities like snaring, fearing, and rooting. These skills make them exceptional soloists. At higher levels, their ability to charm stronger undead pets adds to their soloing prowess. Additionally, their Fear and Feign Death spells enable them to isolate and handle enemies effectively, and the latter provides a means of escape in dire situations. Their DoT spells, though slower, are mana-efficient compared to Direct Damage spells. A distinctive feature of Necromancers is the "Lich" line of spells, which trade health for vastly improved mana regeneration. This begins with Dark Pact and evolves to Call of Bones, transforming the Necromancer into a skeletal form. In group and raid settings, Necromancers adjust their approach. While relying less on DoTs, they still contribute significantly through their pets, health and mana transfers, and various utility functions. In Everquest lore, Necromancers are often portrayed as solitary figures, delving into forbidden knowledge and shrouded in mystery. Their magic is a blend of horror and fascination, as they walk the thin line between life and death. In the hidden corners of Norrath, they conduct their grim rituals, ever seeking to expand their dominion over the forces that govern existence itself. Their presence is a reminder of the darker aspects of magic, where power comes with a price, and mastery over death holds the secrets to untold might.	4
Wizard	Wizards in Everquest are formidable masters of the elemental forces of fire, ice, and pure magic. Their life's pursuit is the mastery of these elements, channeling their deep knowledge into devastating spells that wreak havoc upon their foes. Wizards are known for their single-minded dedication to dealing massive amounts of damage, quickly and efficiently. A hallmark of the Wizard's power is their unparalleled ability in teleportation. They can instantly transport themselves and their allies across the vast expanses of Norrath and even to realms beyond, making them invaluable for quick travel and strategic movements. Wizards specialize in delivering intense magical damage, sacrificing a broader range of spells for this immense destructive power. They become capable solo adventurers, especially skilled in "quad kiting" tactics from level 29. In group settings, their effectiveness can vary. With fast-paced groups, Wizards may face mana challenges, but they excel in situations that allow for more frequent meditation and mana regeneration. This makes them particularly potent in less coordinated groups or in raid scenarios where their burst damage shines. The Wizard class is ideal for players who prioritize high burst damage and prefer solo play or participating in raids. In the lore of Everquest, Wizards are seen as the arcanists of raw elemental power. They are the scholars of the arcane, spending hours in study and experimentation to harness the primal forces of nature. Their towers and laboratories are filled with ancient tomes and arcane artifacts, each a testament to their relentless search for magical prowess. When they unleash their power, it's with a precision and intensity that can alter the course of battles. Wizards are not just spellcasters but forces of nature themselves, channeling the raw energy of Norrath to bend the very fabric of reality to their will.	5
Cleric	Clerics in Everquest are deeply devoted to the gods of Norrath, their allegiance covering a spectrum from benevolent to malevolent. This diversity in faith grants them extraordinary magical powers, and their role extends far beyond the conventional image of clerics as mere healers. Equipped with plate armor and blunt weapons, clerics are a formidable presence in both defense and offense. Their most defining and revered ability is resurrection. This unparalleled power sets clerics apart, as they can bring fallen allies back to life, significantly reducing the usual penalties associated with death. This skill is not just a spell but a miraculous act, embodying the pinnacle of clerical magic and their deep connection with the divine. Alongside resurrection, clerics excel in healing and protective magic. Their spells are crucial in sustaining a group during intense battles, offering unmatched healing and defensive capabilities. While other classes may possess healing abilities, none can match the clerical prowess in this area. Clerics are also potent adversaries against the undead, using their holy might to unleash devastating spells specifically designed to banish these creatures. Typically more group-dependent, clerics are highly coveted members of any party. Their skills in healing, protection, and especially resurrection make them invaluable, often being the key to a group's survival and success. In the broader lore of Everquest, clerics are viewed as the mortal embodiment of their deity's power, regardless of their moral alignment. They are the intermediaries between the divine and the earthly realms, their temples serving as beacons of hope, sanctuaries, or places of darker rites, depending on their faith. In battle, a cleric's prayer for resurrection is a profound moment, showcasing the direct intervention of their deity and the sacred bond between the cleric and their god. Their presence on the battlefield is a testament to the gods' involvement in the mortal world, and their ability to resurrect is a miraculous display of divine favor.	6
Druid	Druids in Everquest are guardians of nature, deeply connected to the wilds and the Norrathian gods of nature. Their devotion to the natural world is reflected in their versatile magic, allowing them to adapt to various roles, whether in a group or on solo adventures. Wearing leather armor and proficient with blunt weapons and scimitars, druids are a formidable presence in any setting. Druidic magic is diverse, encompassing fair healing abilities, potent health regeneration spells, and enhancements that bolster the health and armor of their group. At higher levels, they excel in mana regeneration spells, further amplifying their utility. Offensively, druids are adaptable, with a repertoire including fire and cold-based spells, disease and swarm spells for damage over time, powerful spells against summoned creatures, and the ability to charm animals. However, one of their most celebrated abilities is their mastery of travel magic. Druids can not only hasten their group's movement but also possess the remarkable ability to teleport their group to distant regions, a skill that greatly enhances mobility and strategic positioning. Druids thrive in both solo and group situations, their flexibility making them valuable in various combat scenarios. Their capacity for different play styles and options makes them an excellent choice for players who appreciate versatility. Additionally, their teleportation abilities make them particularly effective at generating income through services like player transport, item farming, and handling challenging enemies like giants. In Everquest lore, druids are seen as the embodiment of the harmony and fury of nature. They are the stewards of the wildlands, drawing their power from the very essence of Norrath's natural world. Their spells are reflections of the elements  the fire of the sun, the chill of the wind, the growth of the earth, and the swarm of the forest. Druids are not just spellcasters but the voice of nature itself, calling upon its raw power to protect, heal, and sometimes unleash its wrath. Their ability to bend space and time through teleportation is more than just a convenience; it's a symbol of their deep connection with the world, allowing them to traverse vast distances in the blink of an eye, as if moving with the speed of nature's own forces.	7
Shaman	 In the world of Everquest, Shamans are the guardians of ancient wisdom, immersed in the sacred traditions of animism and ancestor veneration. Unlike other classes with nature-based affiliations, Shamans derive their power from a profound connection with the ancestral and animal spirits that inhabit Norrath. It's important to note that this connection is not rooted in nature; instead, it stems from a deep understanding of the spiritual essence that permeates all beings. Central to the Shamanic tradition is animism, a belief in the spiritual essence within animals and other entities. Shamans do not commune with nature; they commune with the spirits themselves. This connection allows them to invoke the primal attributes of these spirits, employing them for both offensive and defensive magic. Ancestor veneration is equally significant in Shamanic lore. Shamans act as intermediaries between their people and their forebears, drawing upon the wisdom and power of those who have crossed into the afterlife. This connection is not solely spiritual; it represents a lineage of knowledge and authority deeply ingrained in their cultural and mystical practices. Within their communities, Shamans are esteemed not only for their magical talents but also as spiritual guides and custodians of age-old traditions. Their magic is a fusion of ancestral insight and the primal essence of animals, resulting in a diverse range of abilities. Shamans can heal and empower their allies, as well as afflict and hex their adversaries. Alchemy is a sacred aspect of their craft, as they infuse physical substances with the profound energies they channel. This facet of their magic emphasizes their role as intermediaries between the tangible world and the enigmatic, often concealed forces at play. Playing as a Shaman in Everquest offers a profound journey, delving into the realms of ancestral and animal spirits instead of conventional nature-focused magic. It provides a unique perspective, centered on the spiritual and mystical aspects of existence, making Shamans a captivating and indispensable class for both solo adventurers and group dynamics.	8
Monk	Monks in Everquest embody a philosophy of minimalism and tranquility, adhering to a vow of poverty that reflects their deep commitment to a serene and contemplative life. This vow extends to their approach to material possessions, as they refrain from looting and accumulating wealth, maintaining a state of unburdened simplicity that enhances their martial prowess. Their minimalist lifestyle is not merely a restriction but a conscious choice that aligns with their pursuit of serenity and mastery in martial arts. The absence of encumbrance from worldly possessions allows monks to maintain a state of physical and mental agility, essential for their advanced combat techniques. The monks' practice of feigning death is a profound demonstration of their connection with tranquility and serenity. This skill, where they slow their bodily functions to appear lifeless, is more than a tactical maneuver; it is a meditation on the thin line between life and stillness, a state of deep contemplation and oneness with the serene. In the lore of Everquest, monks are revered not only for their physical abilities but also for their philosophical beliefs. Their monasteries and temples are places of peace, where the principles of minimalism, tranquility, and contemplation are cultivated. Here, monks train their bodies and minds, seeking to transcend the physical realm and attain a state of harmony and balance. Their journey is one of continuous self-reflection and discipline, where every action, from the simplest task to the most complex combat technique, is performed with mindfulness and purpose. This path of serenity and simplicity makes monks unique among the classes of Norrath, offering players an experience that combines the thrill of physical combat with the depth of spiritual practice.	9
Ranger	Rangers in Everquest embody the spirit of the wilds, bridging the gap between the disciplined might of the Warrior and the natural magic of the Druid. They are not merely a combination of these two classes but stand as a distinct embodiment of the versatile guardian of the wilderness. In the lore of Norrath, Rangers are often depicted as the stewards of the natural world, deeply connected to the forests, mountains, and rivers that make up the landscape. They are as comfortable navigating the intricate politics of human kingdoms as they are tracking a beast through the dense underbrush of a darkened forest. Their skills in combat, honed in the wild terrains they call home, are a unique blend of martial prowess and an innate understanding of the rhythms of nature. Rangers use their weapons not just with skill but with an intuitive grace, almost as if they are extensions of the natural world itself. Magic for Rangers is not just a set of spells but an expression of their deep bond with nature. Their spells, drawn from the Druid's affinity with the wild and the elements, are used with a practicality and purpose that reflects their role as protectors and caretakers of the wilderness. Rangers are known for their exceptional tracking ability, a skill that transcends mere hunting. It's a profound understanding of the interconnectedness of all living things, allowing them to read the land like a book and intuit the presence of friend or foe from miles away. The Ranger's journey in Everquest is not just one of physical challenges but also of spiritual growth. They learn to balance the ferocity of a warrior with the gentle hand of a druid, using their strength to protect and their magic to sustain. As guardians of the balance between civilization and the wild, Rangers hold a unique place in Norrath, respected by many for their skills and wisdom, and feared by those who would threaten the natural order of the world. Their path is one of constant adaptation, utilizing all their abilities to protect the realms they cherish.	10
Rogue	In the lore of Everquest, Rogues are the elusive and cunning masters of the shadows, thriving in the unseen corners of Norrath. More than mere thieves or assassins, they are the embodiment of stealth and guile, using their unique skills to navigate a world fraught with danger and opportunity. Rogues in Norrath are not just fighters; they are artists of subterfuge, blending seamlessly into their surroundings, striking when least expected. Their mastery of stealth allows them to traverse perilous territories, undetected by most. They are the unseen watchers, gathering information and waiting for the perfect moment to strike. Backstabbing is not merely a skill for Rogues but a symbol of their ability to outwit and outmaneuver their opponents. They strike from the shadows with deadly precision, often leaving their foes bewildered and defeated before they even realize what hit them. The use of poisoned weapons adds another layer to their lethal arsenal, showcasing their preparedness and cunning. Their talents extend beyond combat. Rogues possess a unique set of abilities that make them indispensable in any adventure. They can detect and disarm traps, pick locks, and even pick pockets, skills that reflect their resourcefulness and adaptability. Their ability to fall safely from great heights is a testament to their agility and awareness of their environment. Rogues are not solitary figures; they understand the value of allies. In a group, they excel, adding significant power to any encounter. Their role is not just to deal damage but to provide strategic advantages, whether scouting ahead, opening locked passages, or taking down key targets. The life of a Rogue in Everquest is one of constant vigilance and thrill. They walk the fine line between danger and excitement, always searching for the next challenge, the next treasure. Their path is for those who relish the art of stealth, the thrill of the heist, and the satisfaction of a well-placed strike from the shadows. Rogues are a testament to the idea that the unseen and the unpredictable can be the most powerful forces in any adventure.	11
Paladin	Paladins in Everquest are the epitome of devotion and chivalry, setting them apart as more than just a combination of Clerics and Warriors. These noble warriors are bound by sacred oaths of devotion to uphold justice and fight against evil, particularly the undead, that threaten the lands of Norrath. Their path is one of unwavering dedication, not only to their martial training but also to a higher set of principles. Paladins embody the ideals of honor and righteousness, serving as beacons of hope and courage in the darkest of times. They are revered not just for their prowess in battle but also for their commitment to the greater good. Unlike Clerics or Warriors, Paladins are granted divine powers as a testament to their devotion. This divine favor allows them to perform feats beyond the scope of mere physical strength or battle skill. Their ability to channel this power manifests in unique ways, such as imbuing their weapons with holy wrath or casting protective spells to shield their allies. The Paladin's renowned ability to Lay Hands, healing with a mere touch, is more than just a healing technique; it's a symbol of their divine mandate to protect life and vanquish evil. It reflects their role as custodians of a sacred trust, endowed with the power to bring light to the darkest corners of Norrath. In groups, Paladins are not just fighters; they are leaders and protectors, guiding their comrades with wisdom and courage. Their presence on the battlefield is inspiring, rallying allies and instilling fear in the hearts of their enemies. Choosing the path of a Paladin in Everquest is to embrace a life of devotion, to stand as a guardian against the forces of darkness, and to uphold the virtues of justice and valor in a world rife with peril and intrigue. It's a role that offers a unique blend of combat and divine power, ideal for players who seek to embody the virtues of a true knight in both deed and action.	12
Shadow Knight	In the shadowed realms of Norrath, Shadow Knights are the embodiment of terror and dread, a sinister union of combat prowess and dark sorcery. These fearsome warriors are not merely practitioners of the dark arts, but connoisseurs of fear, experts in instilling horror in the hearts of their enemies. Shadow Knights wield their formidable powers to manipulate and control the essence of fear itself. They are the harbingers of despair, utilizing their necromantic abilities to summon an aura of dread that permeates the battlefield. Their very presence is enough to unsettle the bravest of hearts, turning the tide of battles with the sheer force of their malevolent will. The path of a Shadow Knight is steeped in the darker aspects of power, where terror is a tool as sharp as any blade. In combat, they revel in the chaos and fear they sow, using their dark magic to weaken and terrify their foes before striking with merciless precision. Their spells and abilities are designed to break the spirit and resolve of their enemies, leaving them vulnerable and exposed. Beyond the battlefield, the legacy of a Shadow Knight is one of whispered tales and fearful glances. They are the stuff of nightmares, figures cloaked in darkness and mystery, often as feared by their allies as they are by their enemies. To stand beside a Shadow Knight In the shadowed realms of Norrath, Shadow Knights are the embodiment of terror and dread, a sinister union of combat prowess and dark sorcery. These fearsome warriors are not merely practitioners of the dark arts, but connoisseurs of fear, experts in instilling horror in the hearts of their enemies. Shadow Knights wield their formidable powers to manipulate and control the essence of fear itself. They are the harbingers of despair, utilizing their necromantic abilities to summon an aura of dread that permeates the battlefield. Their very presence is enough to unsettle the bravest of hearts, turning the tide of battles with the sheer force of their malevolent will. The path of a Shadow Knight is steeped in the darker aspects of power, where terror is a tool as sharp as any blade. In combat, they revel in the chaos and fear they sow, using their dark magic to weaken and terrify their foes before striking with merciless precision. Their spells and abilities are designed to break the spirit and resolve of their enemies, leaving them vulnerable and exposed. Beyond the battlefield, the legacy of a Shadow Knight is one of whispered tales and fearful glances. They are the stuff of nightmares, figures cloaked in darkness and mystery, often as feared by their allies as they are by their enemies. To stand beside a Shadow Knight is to be in the presence of the living embodiment of dread, a constant reminder of the dark and terrifying aspects of power that lurk in the world of Norrath.	13
Warrior	In the grand saga of Everquest, Warriors stand as the quintessential champions of armed conflict, embodying the very essence of martial prowess. They are not mere soldiers but the vanguard of any battle, facing the most fearsome creatures of Norrath with unyielding courage and strength. In the lore of Norrath, Warriors are more than their armor and weapons; they are the living symbols of bravery and resilience. Their lives are dedicated to the mastery of combat, honing their bodies and minds to become the ultimate fighting force. Each Warrior is a tale of endurance, training relentlessly to build unmatched strength and stamina. The battlefield is the Warrior's realm, where their skills are showcased in their full, awe-inspiring glory. Clad in imposing plate armor and armed with a diverse arsenal, they wade into battle with a confidence born of rigorous training and innate valor. Their defensive skills are legendary, allowing them to withstand assaults that would fell lesser combatants. More than just fighters, Warriors are tacticians. They understand the ebb and flow of combat, using their prowess to draw the attention of enemies, shielding their comrades and ensuring the safety of the less armored. Their ability to taunt and engage multiple foes is not just a skill but a strategic necessity, making them indispensable in any group. In the stories and songs of Norrath, Warriors are often celebrated as heroes, the stalwarts who stand at the forefront of epic battles and daring adventures. Their presence brings a sense of security and confidence to any party, knowing that the front line is held by a Warrior, unflinching and steadfast. Choosing the path of a Warrior in Everquest is to embrace the heart of combat, to stand as the bulwark against the darkness that threatens the world. It's a commitment to the ideals of courage, honor, and strength, a journey that is both challenging and profoundly rewarding for those who seek to be the embodiment of the warrior spirit.	14
